import React, { useState, useRef, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";

export default function Header() {
  const navigate = useNavigate();
  const userInfo = localStorage.getItem("userInfo") ? JSON.parse(localStorage.getItem("userInfo")) : null;
  const [open, setOpen] = useState(false);
  const menuRef = useRef(null);
  const logout = () => {
    localStorage.removeItem("userInfo");
    navigate("/login");
  };
  useEffect(() => {
    const onClick = (e) => {
      if (menuRef.current && !menuRef.current.contains(e.target)) setOpen(false);
    };
    document.addEventListener("click", onClick);
    return () => document.removeEventListener("click", onClick);
  }, []);

  return (
    <nav className="navbar navbar-expand-lg bg-body-tertiary shadow-sm sticky-top">
      <div className="container">
        <Link className="navbar-brand fw-bold" to="/">EventHub</Link>
        <button className="navbar-toggler" type="button" onClick={() => setOpen((o) => !o)}><span className="navbar-toggler-icon" /></button>
        <div className={`navbar-collapse ${open ? "show" : "collapse"}`} id="mainNav">
          <ul className="navbar-nav ms-auto align-items-lg-center gap-lg-3">
            <li className="nav-item d-none d-md-block"><Link className="nav-link" to="/organizer/create" title="Create an event"><i className="bi bi-plus-lg me-1" />Create an event</Link></li>
            <li className="nav-item d-none d-md-block"><Link className="nav-link" to="/?liked=1" title="Likes"><i className="bi bi-heart me-1" />Likes</Link></li>
            <li className="nav-item d-none d-md-block"><Link className="nav-link" to="/bookings" title="Tickets"><i className="bi bi-ticket-perforated me-1" />Tickets</Link></li>
            {userInfo ? (
              <>
                <li className="nav-item dropdown" ref={menuRef}>
                  <button className="btn btn-outline-primary dropdown-toggle" onClick={() => setOpen((o) => !o)}>
                    {userInfo.username || userInfo.email || "Account"}
                  </button>
                  {open && (
                    <div className="dropdown-menu dropdown-menu-end show mt-2 p-2" style={{ minWidth: 260 }}>
                      <Link className="dropdown-item" to="/" onClick={() => setOpen(false)}>Browse events</Link>
                      <Link className="dropdown-item" to="/bookings" onClick={() => setOpen(false)}>Tickets</Link>
                      <Link className="dropdown-item" to="/?liked=1" onClick={() => setOpen(false)}>Liked</Link>
                      <Link className="dropdown-item" to="/organizer/events" onClick={() => setOpen(false)}>Following</Link>
                      <Link className="dropdown-item" to="/" onClick={() => setOpen(false)}>Interests</Link>
                      {userInfo.role === "organizer" && (
                        <>
                          <div className="dropdown-divider" />
                          <Link className="dropdown-item" to="/organizer/events" onClick={() => setOpen(false)}>My events</Link>
                          <Link className="dropdown-item" to="/organizer/verify" onClick={() => setOpen(false)}>Verify tickets</Link>
                        </>
                      )}
                      <div className="dropdown-divider" />
                      <Link className="dropdown-item" to="/profile" onClick={() => setOpen(false)}>Account settings</Link>
                      <button className="dropdown-item text-danger" onClick={logout}>Log out</button>
                    </div>
                  )}
                </li>
              </>
            ) : (
              <>
                <li className="nav-item"><Link className="nav-link" to="/">Find Events</Link></li>
                <li className="nav-item"><Link className="nav-link" to="/organizer/create">Create Events</Link></li>
                <li className="nav-item"><a className="nav-link" href="#">Help Center</a></li>
                <li className="nav-item"><Link className="nav-link" to="/bookings">Find my tickets</Link></li>
                <li className="nav-item"><Link className="btn btn-outline-primary" to="/login">Log In</Link></li>
                <li className="nav-item"><Link className="btn btn-primary ms-lg-2" to="/register">Sign Up</Link></li>
              </>
            )}
          </ul>
        </div>
      </div>
    </nav>
  );
}
